// src/component/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/mrbeans.png'; // Pastikan jalur ini sesuai dengan lokasi file Anda

const Navbar = () => {
  return (
    <nav className="flex justify-between items-center bg-white p-4 shadow-md fixed w-full z-10"> {/* Fixed navbar */}
      <Link to="/">
        <img src={logo} alt="Bean Roast Logo" className="h-10 cursor-pointer" /> {/* Adjust height as needed */}
      </Link>
      <div className="flex items-center space-x-6"> {/* Space between nav links */}
        <Link to="/" className="text-gray-800 font-bold font-permanent-marker hover:underline">Home</Link>
        <Link to="/about" className="text-gray-800 font-bold font-permanent-marker hover:underline">About</Link>
        <Link to="/coffees" className="text-gray-800 font-bold font-permanent-marker hover:underline">Coffee List</Link>
        <Link to="/profile" className="text-gray-800 font-bold font-permanent-marker hover:underline">Profile</Link>
        <Link to="/contact" className="text-gray-800 font-bold font-permanent-marker hover:underline">Contact</Link>
      </div>
    </nav>
  );
};

export default Navbar;
